import React from 'react';
import List from '../../List/List';
import {CountryContextConsumer} from '../CountryInterface';

const CountryList: React.FC = () => {
    return <ul>
        <CountryContextConsumer>
            {value => <List>{value}</List>}
        </CountryContextConsumer>
    </ul>
};

export default CountryList;
